import { styled, Card, Button, CardActions, CardMedia } from "@mui/material";

export const MyCard = styled(Card)({
  width: "445px",
  height: "450px",
  margin: "20px",
  alignItems: "center",
});

export const MyTypography = styled("span")({
  display: "inline-block",
  overflow: "auto",
  height: "50px",
  fontSize:"12px",
  margin: "0px"
});

export const MyButton = styled(Button)({
  textTransform: "capitalize",
})

export const MyActions = styled(CardActions)({
  justifyContent: "right",
  paddingRight: "16px",
})

export const MyMedia = styled(CardMedia)({
  objectFit: "cover",
})
